import React from "react";
import "./TemperatureComponent.css";
const TemperatureComponents = () => {
  return (
    <div className="temmperatureComponents">
      <div>
        <h4>Lowest Temperature</h4>
        <h5>23°C</h5>
      </div>
      <div>
        <h4>
          <i class="fa-thin fa-arrow-up-long"></i>Highest Temerature
        </h4>
        <h5>23°C</h5>
      </div>
      <div>
        <h4>
          <i class="fa-regular fa-wind"></i>Wind speed
        </h4>
        <h5>56 m/s</h5>
      </div>
    </div>
  );
};

export default TemperatureComponents;
